import React from "react";
import Grid from "@material-ui/core/Grid";

const BookList = ({ books }) => {

	return (
    <div className="book-list">
		<Grid container spacing={4}>
  			{books.map((book) => (
          <Grid item md={2}>
            <img className="book-cover" src={book.image}/>
      			<p><i>{book.title}</i></p>
            <p>by {book.author}</p>
      			<p>{book.rating}</p>
          </Grid>
  			))}
    </Grid>
    </div>
	);
};

export default BookList;
